import { Text, View } from "react-native";

export default function Saludar() {
  return (
    <View>
      <View>
        <Text onPress={() =>props.navigation.navigate('L')}>Ingresa estos datos para iniciar</Text>
        <Text>¿Olvidaste tu contraseña?</Text>
      </View>
    </View>
  );
}
